import style from "./InitialPage.module.scss";
import { BoxesMenuItem } from "./BoxesMenuItem/BoxesMenuItem";

const InitialPage = () => {
  return (
    <div className={style.boxesContainer}>
      <BoxesMenuItem
        textContent="Повторить слова"
        imgContent="people_2.png"
        link="/CardRepeater"
      />
      <BoxesMenuItem
        textContent="Словарь"
        imgContent="people_1.png"
        link="/CardList"
      />
      <BoxesMenuItem
        textContent="Алфавит"
        imgContent="people_3.png"
        link="/CardRepeater"
      />
      <BoxesMenuItem
        textContent="Грамматика"
        imgContent="people_2.png"
        link="/CardRepeater"
      />
    </div>
  );
};

export { InitialPage };
